import React, { useState } from 'react'
import './Setting.css';


function Setting({ totalAmount }) {
const [employeeNumber, setEmployeeNumber] = useState(1);
const [profitPercent, setProfitPercent] = useState(100);

const costPerPerson = totalAmount / employeeNumber;
return (
    <div >
        <input type='number' name="employeeNumber" onChange={(e) => setEmployeeNumber(e.target.value)}/>
        <input type='number' name='profitPercent' onChange={(e) => setProfitPercent(e.target.value)}/>
    </div>
);

}

export default Setting;
